;;; ### on a stream
;; **

;; @@
(defn in-front-slow [buffer]  
  (let [ 
        img (clone buffer)
        rect (new-rect (new-point 5 5) (new-size (- (.width buffer) 5) (- (.height buffer) 5 )))
        mask (new-mat)
        pfg-mask (new-mat)
        source1 (new-mat 1 1 CV_8U (new-scalar 3.0))
        pfg_foreground (-> buffer (u/mat-from)  (set-to (new-scalar 0 0 0)))]
   
    (grab-cut img mask rect (new-mat) (new-mat) 7 GC_INIT_WITH_RECT)
    (compare mask source1 pfg-mask CMP_EQ)
    (copy-to buffer pfg_foreground pfg-mask)
    pfg_foreground))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;homeless-dusk/in-front-slow</span>","value":"#'homeless-dusk/in-front-slow"}
;; <=

;; @@
(u/simple-cam-window in-front-slow)
;; @@
;; ->
;;; {:frame {:color 00, :title video, :width 400, :height 400}, :video {:device 0, :width 200, :height 220}}
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(defn in-front [resolution-factor buffer]  
  (let [ 
        img (clone buffer)
        rect (new-rect (new-point 5 5) (new-size (- (.width buffer) 5) (- (.height buffer) 5 )))
        mask (new-mat)
        pfg-mask (new-mat)
        source1 (new-mat 1 1 CV_8U (new-scalar 3.0))
        pfg_foreground (-> buffer (u/mat-from)  (set-to (new-scalar 0 0 0)))]
    
  	(dotimes [_ resolution-factor] (pyr-down! img))  
    (grab-cut img mask rect (new-mat) (new-mat) 7 GC_INIT_WITH_RECT)
    (dotimes [_ resolution-factor] (pyr-up! mask))
    
    (compare mask source1 pfg-mask CMP_EQ)
    (copy-to buffer pfg_foreground pfg-mask)
    pfg_foreground))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;homeless-dusk/in-front</span>","value":"#'homeless-dusk/in-front"}
;; <=

;; @@
(u/simple-cam-window (partial in-front 2))
